Accounts_CustomFields_Description:
應該是有效的JSON，其中鍵是包含字段設置字典的字段名稱。例如:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
},
"twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
應該是有效的JSON，其中鍵是包含鍵和翻譯字典的語言。例如:<br/><code>{
 "en": {
  "Channels": "Rooms"
 }, 
"pt":{
  "Channels": "Salas"
 }
}</code>
